import React, { Component } from 'react'

class PieceComponent extends Component {
    constructor(props) {
        super(props)
    }

    render() {
        const {symbol,selected,canMove} = this.props;
        return (
            <div style={(selected || canMove) &&{background: rgb(0, 200, 10)}}>
                {symbol}
                {(selected || canMove) &&<div class="box overlay"></div>}
            </div>
        )
    }
}

export default PieceComponent
